import Button from "../components/Button";

const Test = () => {
    return (
        <div>
            <Button text="1"/>
            <Button text="2"/>
            <Button text="3"/>
            <Button text="4"/>
            <Button text="5"/>
        </div>
    )
}

export default Test;
